textOriginal:
Thiago dos Reis e Leo Stoppa vcs já estão na historia politica do Brasil!!! Parabéns como diz a bilblia;
Vcs lutaram e lutam o bom combate.
Desde aquela prisão armada e injusta do presidente Lula acompanho o conteúdo de vcs nas redes primeiro face e agora aqui pq o face virou um campo extremamente facista por isso nem eu e muitos não usam mais. Sucesso rumo ao seu primeiro milhão. Eu gostaria que as pessoas daqui buscassem tbm se inscrever pra o meu xara tbm chegar ao primeiro milhão dele um cara extremamente inteligente politicamente como vc. E outra tenho absoluta certeza que mesmo que o próximo presidente seja o Lula vcs por serem inteligentes baterão forte se ele pisar na bola.
